'''
给定一个字符串 s，你可以通过在字符串前面添加字符将其转换为回文串。找到并返回可以用这种方式转换的最短回文串。


示例 1：

输入：s = "aacecaaa"
输出："aaacecaaa"

示例 2：

输入：s = "abcd"
输出："dcbabcd"

提示：

0 <= s.length <= 5 * 104
s 仅由小写英文字母组成
'''
from leetcode.tools.time import printTime


class Solution:
    @printTime()
    def shortestPalindrome(self, s: str) -> str:
        n = len(s)
        index = n - 1
        ret = ''
        while index > 0:
            if s[index] == s[0]:
                left = 0
                right = index
                found = True
                while left <= right:
                    if s[left] != s[right]:
                        found = False
                        break
                    left += 1
                    right -= 1
                if found:
                    break
            index -= 1
        for i in range(n - 1, index, - 1):
            ret += s[i]
        ret += s
        return ret

s = ""
Solution().shortestPalindrome(s)